import fetcher from '../fetcher';

const getFilterApartments = async (handleSuccess, query) => {
    try{
        const {data} = await fetcher.get(`/apartments/${query}`);
        return data;
    }catch(error){
        throw new Error(`Cant get apartments`);
    }
}

const getImagesByApartmentId = async (apartmentId) => {
    try {
        const {data} = await fetcher.get(`/images/${apartmentId}`);
        return data
    } catch(error){
        throw new Error(`Cant get images`);
    }
} 

export {getImagesByApartmentId};
